seperations = [ 1,2,4,6,8,14,24,40 ]

plotColours = ["rx-", "bo--", "g.:", "m^-."]

def plotPositionErrors( inputDatasets, inputNames ):
    plt.figure(1)
     
    finalValSet  = []
    
    colIndx = 0
    
    highestNonNan = 0
    
    for dataset, name in zip(inputDatasets, inputNames): 
        finalVal = []
        for data, seperation in zip( dataset, seperations ):
            notNullMask = np.array(data[2])
            
            cInitVal = ( np.mean( np.sqrt(np.array(data[0])[:,0]**2 + np.array(data[0])[:,1]**2) ) )
            cFinalVal = ( np.mean( np.sqrt(np.array(data[1])[notNullMask][:,0]**2 + np.array(data[1])[notNullMask][:,1]**2) ) )
            
            finalVal.append( (cInitVal - cFinalVal)*100/cInitVal )
         
        finalValSet.append( finalVal )
        
        highestNonNan = max( np.where(~np.isnan(np.array(finalVal)))[0][-1], highestNonNan )
        
        plt.plot( seperations, finalVal, plotColours[colIndx], label=name )
        colIndx += 1
    
    #plt.plot( seperations[0:(highestNonNan+1)], initVal[0:(highestNonNan+1)], "-", label="initial value" )
    plt.title( "Displacement error change" )
    plt.xlabel( "Comparison frame seperation" )
    plt.ylabel( "Percentage displacement error reduction" )
    plt.xticks( seperations[0:(highestNonNan+1)] )
    plt.legend()
    plt.show(block=False)
    
def plotAngularErrors( inputDatasets, inputNames ):
    plt.figure(2)
     
    finalValSet  = []
    
    colIndx = 0
    
    highestNonNan = 0
    
    for dataset, name in zip(inputDatasets, inputNames): 
        finalVal = []
        for data, seperation in zip( dataset, seperations ):
            notNullMask = np.array(data[2])
            
            cInitVal = ( np.mean(  np.array(data[0])[:,2] ) )
            cFinalVal = np.mean(  np.array(data[1])[notNullMask][:,2] )
            
            finalVal.append( (cInitVal - cFinalVal)*100/cInitVal )
         
        finalValSet.append( finalVal )
        
        highestNonNan = max( np.where(~np.isnan(np.array(finalVal)))[0][-1], highestNonNan )
        
        plt.plot( seperations, finalVal, plotColours[colIndx], label=name )
        colIndx += 1
    
    #plt.plot( seperations[0:(highestNonNan+1)], initVal[0:(highestNonNan+1)], "-", label="initial value" )
    plt.title( "Angular error change" )
    plt.xlabel( "Comparison frame seperation" )
    plt.ylabel( "Percentage angular error reduction" )
    plt.xticks( seperations[0:(highestNonNan+1)] )
    plt.legend()
    plt.show(block=False)
    
